import React, { useState } from "react";

const mindMapData = {
  label: "ME",
  color: "bg-lime-500",
  children: [
    {
      label: "Tech Stack",
      color: "bg-blue-400",
      position: { x: 0, y: -180 },
      children: [
        { label: "Java", color: "bg-blue-300", position: { x: -160, y: -240 } },
        { label: "JavaScript", color: "bg-blue-300", position: { x: 0, y: -260 } },
        { label: "HTML/CSS", color: "bg-blue-200", position: { x: 160, y: -240 } },
        { label: "Python", color: "bg-blue-200", position: { x: -120, y: -160 } },
        { label: "C#", color: "bg-blue-200", position: { x: 120, y: -160 } },
        { label: "Vue.js", color: "bg-blue-100", position: { x: -80, y: -80 } },
        { label: "Django", color: "bg-blue-100", position: { x: 80, y: -80 } }
      ]
    },
    {
      label: "Hobbies",
      color: "bg-orange-400",
      position: { x: -180, y: 120 },
      children: [
        {
          label: "Game",
          color: "bg-orange-300",
          position: { x: -220, y: 220 },
          children: [
            { label: "Diablo", color: "bg-orange-200", position: { x: -240, y: 300 } },
            { label: "Animal Crossing", color: "bg-orange-100", position: { x: -180, y: 300 } },
            { label: "Mine Craft", color: "bg-orange-100", position: { x: -120, y: 300 } }
          ]
        },
        {
          label: "Writing", color: "bg-orange-300", position: { x: -80, y: 220 },
          children: [
            { label: "Essay", color: "bg-orange-200", position: { x: -100, y: 300 } },
            { label: "Novel", color: "bg-orange-100", position: { x: -40, y: 300 } }
          ]
        },
        {
          label: "Listening Music", color: "bg-orange-300", position: { x: 60, y: 220 },
          children: [
            { label: "Classical Music", color: "bg-orange-200", position: { x: 40, y: 300 } },
            { label: "Jazz", color: "bg-orange-200", position: { x: 100, y: 300 } },
            { label: "K-pop", color: "bg-orange-100", position: { x: 160, y: 300 } }
          ]
        },
        { label: "Piano", color: "bg-orange-200", position: { x: 180, y: 220 } },
        { label: "Game Making", color: "bg-orange-100", position: { x: 240, y: 220 } },
        { label: "Caligraphy", color: "bg-orange-100", position: { x: 300, y: 220 } }
      ]
    },
    {
      label: "Languages",
      color: "bg-purple-700",
      position: { x: 180, y: 120 },
      children: [
        { label: "Korean ⭐⭐⭐", color: "bg-purple-600", position: { x: 180, y: 200 } },
        { label: "English ⭐⭐", color: "bg-purple-500", position: { x: 240, y: 200 } },
        { label: "Chinese ⭐⭐", color: "bg-purple-400", position: { x: 300, y: 200 } },
        { label: "Japanese ⭐", color: "bg-purple-300", position: { x: 360, y: 200 } }
      ]
    }
  ]
};

export default function MindMapPage() {
  const [path, setPath] = useState([]);
  const currentNode = path[path.length - 1] || mindMapData;
  const isRoot = path.length === 0;

  const center = {
    x: window.innerWidth / 2 - 70,
    y: window.innerHeight / 2 - 70
  };

  const handleClick = (node) => {
    if (node === currentNode && path.length > 0) {
      setPath((prev) => prev.slice(0, -1));
    } else if (node.children) {
      setPath((prev) => [...prev, node]);
    }
  };

  const baseCircleClass =
    "absolute rounded-full text-white text-center flex items-center justify-center shadow-xl border-4 border-white/20 dark:border-white/10 bg-[radial-gradient(ellipse_at_top_left,_var(--tw-gradient-stops))] from-white/10 to-black/10";

  return (
    <div className="relative w-screen h-screen bg-white dark:bg-gray-900 overflow-hidden">
      <button
        className={`w-28 h-28 ${currentNode.color} font-bold text-xl z-10 ${baseCircleClass}`}
        style={{ left: center.x, top: center.y }}
        onClick={() => handleClick(currentNode)}
      >
        {currentNode.label}
      </button>

      {!isRoot &&
        currentNode.children &&
        currentNode.children.map((child) => (
          <button
            key={child.label}
            style={{
              left: center.x + (child.position?.x || 0),
              top: center.y + (child.position?.y || 0)
            }}
            className={`w-20 h-20 ${child.color} font-semibold z-0 ${baseCircleClass}`}
            onClick={() => handleClick(child)}
          >
            {child.label}
          </button>
        ))}
    </div>
  );
}
